      TopicWrapper >
      <
      TopicItem >
      <
      img src = "https://upload.jianshu.io/users/upload_avatars/8972166/027bf05a-67fa-459e-b61c-c73ce267367c.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp" / >
      社会热点 <
      /TopicItem> <
      /TopicWrapper>
    );
  }
}

export default Topic;
